//from https://stackoverflow.com/questions/1344500/efficient-way-to-insert-a-number-into-a-sorted-array-of-numbers
function insertSorted(array, value) {
	let low = 0,
			high = array.length;

	while (low < high) {
			let mid = (low + high) >>> 1;
			if (array[mid] < value) low = mid + 1;
			else high = mid;
	}
	array.splice(low,0,value)
	return array
}
