function line3DConncected(endX, endY, endZ, startX, startY, startZ, array){
	var x1 = Math.round(endX), y1 = Math.round(endY), z1 = Math.round(endZ), x0 = Math.round(startX), y0 = Math.round(startY), z0 = Math.round(startZ);
	var dx = Math.abs(x1 - x0);
	var dy = Math.abs(y1 - y0);
	var dz = Math.abs(z1 - z0);
	var stepX = x0 < x1 ? 1 : -1;
	var stepY = y0 < y1 ? 1 : -1;
	var stepZ = z0 < z1 ? 1 : -1;
	var hypotenuse = Math.sqrt(dx*dx + dy*dy + dz*dz);
	var tMaxX = hypotenuse*0.5 / dx;
	var tMaxY = hypotenuse*0.5 / dy;
	var tMaxZ = hypotenuse*0.5 / dz;
	var tDeltaX = hypotenuse / dx;
	var tDeltaY = hypotenuse / dy;
	var tDeltaZ = hypotenuse / dz;
	while (x0 !== x1 || y0 !== y1 || z0 !== z1){
		if (tMaxX < tMaxY) {
				if (tMaxX < tMaxZ) {
						x0 = x0 + stepX;
						tMaxX = tMaxX + tDeltaX;
				} else if (tMaxX > tMaxZ){
						z0 = z0 + stepZ;
						tMaxZ = tMaxZ + tDeltaZ;
				} else{
						x0 = x0 + stepX;
						tMaxX = tMaxX + tDeltaX;
						z0 = z0 + stepZ;
						tMaxZ = tMaxZ + tDeltaZ;
				}
		} else if (tMaxX > tMaxY){
				if (tMaxY < tMaxZ) {
						y0 = y0 + stepY;
						tMaxY = tMaxY + tDeltaY;
				} else if (tMaxY > tMaxZ){
						z0 = z0 + stepZ;
						tMaxZ = tMaxZ + tDeltaZ;
				} else{
						y0 = y0 + stepY;
						tMaxY = tMaxY + tDeltaY;
						z0 = z0 + stepZ;
						tMaxZ = tMaxZ + tDeltaZ;

				}
		} else{
				if (tMaxY < tMaxZ) {
						y0 = y0 + stepY;
						tMaxY = tMaxY + tDeltaY;
						x0 = x0 + stepX;
						tMaxX = tMaxX + tDeltaX;
				} else if (tMaxY > tMaxZ){
						z0 = z0 + stepZ;
						tMaxZ = tMaxZ + tDeltaZ;
				} else{
						x0 = x0 + stepX;
						tMaxX = tMaxX + tDeltaX;
						y0 = y0 + stepY;
						tMaxY = tMaxY + tDeltaY;
						z0 = z0 + stepZ;
						tMaxZ = tMaxZ + tDeltaZ;

				}
		}
		array.push(x0, y0, z0);
	}
}
//https://www.geeksforgeeks.org/bresenhams-algorithm-for-3-d-line-drawing/
function line3D(x2, y2, z2, x1, y1, z1, array){
	x1 = round(x1)
	y1 = round(y1)
	z1 = round(z1)
	x2 = round(x2)
	y2 = round(y2)
	z2 = round(z2)
	array.push(x1, y1, z1);
	let dx = abs(x2 - x1);
	let dy = abs(y2 - y1);
	let dz = abs(z2 - z1);
	let xs;
	let ys;
	let zs;
	if (x2 > x1) {
		xs = 1;
	} else {
		xs = -1;
	}
	if (y2 > y1) {
		ys = 1;
	} else {
		ys = -1;
	}
	if (z2 > z1) {
		zs = 1;
	} else {
		zs = -1;
	}

	// Driving axis is X-axis"
	if (dx >= dy && dx >= dz) {
		let p1 = 2 * dy - dx;
		let p2 = 2 * dz - dx;
		while (x1 != x2) {
			x1 += xs;
			if (p1 >= 0) {
				y1 += ys;
				p1 -= 2 * dx;
			}
			if (p2 >= 0) {
				z1 += zs;
				p2 -= 2 * dx;
			}
			p1 += 2 * dy;
			p2 += 2 * dz;
			array.push(x1, y1, z1);
		}

		// Driving axis is Y-axis"
	} else if (dy >= dx && dy >= dz) {
		let p1 = 2 * dx - dy;
		let p2 = 2 * dz - dy;
		while (y1 != y2) {
			y1 += ys;
			if (p1 >= 0) {
				x1 += xs;
				p1 -= 2 * dy;
			}
			if (p2 >= 0) {
				z1 += zs;
				p2 -= 2 * dy;
			}
			p1 += 2 * dx;
			p2 += 2 * dz;
			array.push(x1, y1, z1);
		}

		// Driving axis is Z-axis"
	} else {
		let p1 = 2 * dy - dz;
		let p2 = 2 * dx - dz;
		while (z1 != z2) {
			z1 += zs;
			if (p1 >= 0) {
				y1 += ys;
				p1 -= 2 * dz;
			}
			if (p2 >= 0) {
				x1 += xs;
				p2 -= 2 * dz;
			}
			p1 += 2 * dy;
			p2 += 2 * dx;
			array.push(x1, y1, z1);
		}
	}
}
