class PerlinNoise {
	// http://www.noisemachine.com/talk1/17b.html
	// http://mrl.nyu.edu/~perlin/noise/

	static grad3d(i, x, y, z) {
		const h = i & 15; // convert into 12 gradient directions

		const u = h < 8
			? x
			: y;

		const v = h < 4
			? y
			: h === 12 || h === 14
				? x
				: z;

		return ((h & 1) === 0 ? u : -u) + ((h & 2) === 0 ? v : -v)
	}

	static grad2d(i, x, y) {
		const v = (i & 1) === 0
			? x
			: y;

		return (i & 2) === 0
			? -v
			: v;
	}

	static grad1d(i, x) {
		return (i & 1) === 0
			? -x
			: x;
	}

	static lerp(t, a, b) {
		return a + t * (b - a);
	}

	// end of statics

	// permutation
	perm = new Uint8Array(0x200);

	// prototype functions:
	noise3d(x, y, z) {
		const { floor } = Math;

		const X = floor(x) & 0xff;
		const Y = floor(y) & 0xff;
		const Z = floor(z) & 0xff;

		x -= floor(x);
		y -= floor(y);
		z -= floor(z);

		const fx = (3 - 2 * x) * x * x;
		const fy = (3 - 2 * y) * y * y;
		const fz = (3 - 2 * z) * z * z;

		const { perm } = this;

		const p0 = perm[X] + Y;
		const p00 = perm[p0] + Z;
		const p01 = perm[p0 + 1] + Z;
		const p1 = perm[X + 1] + Y;
		const p10 = perm[p1] + Z;
		const p11 = perm[p1 + 1] + Z;

		const { lerp, grad3d } = PerlinNoise;

		return lerp(
			fz,
			lerp(
				fy,
				lerp(
					fx,
					grad3d(perm[p00], x, y, z),
					grad3d(perm[p10], x - 1, y, z)
				),
				lerp(
					fx,
					grad3d(perm[p01], x, y - 1, z),
					grad3d(perm[p11],x - 1, y - 1, z)
				)
			),
			lerp(
				fy,
				lerp(
					fx,
					grad3d(perm[p00 + 1], x, y, z - 1),
					grad3d(perm[p10 + 1], x - 1, y, z - 1)
				),
				lerp(
					fx,
					grad3d(perm[p01 + 1], x, y - 1, z - 1),
					grad3d(perm[p11 + 1], x - 1, y - 1, z - 1)
				)
			)
		);
	}

	noise2d(x, y) {
		const { floor } = Math;

		const X = floor(x) & 0xff;
		const Y = floor(y) & 0xff;

		x -= floor(x);
		y -= floor(y);

		const { perm } = this;
		const fx = (3 - 2 * x) * x * x;
		const fy = (3 - 2 * y) * y * y;
		const p0 = perm[X] + Y;
		const p1 = perm[X + 1] + Y;

		const { lerp, grad2d } = PerlinNoise;

		return lerp(
			fy,
			lerp(
				fx,
				grad2d(
					perm[p0],
					x,
					y
				),
				grad2d(
					perm[p1],
					x - 1,
					y
				)
			),
			lerp(
				fx,
				grad2d(
					perm[p0 + 1],
					x,
					y - 1
				),
				grad2d(
					perm[p1 + 1],
					x - 1,
					y - 1
				)
			)
		);
	}

	noise1d(x) {
		const { floor } = Math;

		const X = floor(x) & 0xff;

		x -= floor(x);

		const fx = (3 - 2 * x) * x * x;

		const { lerp, grad1d } = PerlinNoise;

		return lerp(
			fx,
			grad1d(perm[X], x),
			grad1d(perm[X + 1], x - 1)
		);
	}

	constructor(seed) {
		if (seed === undefined) {
			throw new TypeError("A value for `seed` parameter was not provided to `PerlinNoise`");
		}

		const rnd = new Marsaglia(seed);

		// generate permutation
		const { perm } = this;

		// fill 0x0..0x100
		for (let i = 0; i < 0x100; ++i) {
			perm[i] = i;
		}

		for (let i = 0; i < 0x100; ++i) {
			const j = rnd.nextInt() & 0xFF;
			const t = perm[j];
			perm[j] = perm[i];
			perm[i] = t;
		}

		// copy to avoid taking mod in perm[0]
		// copies from first half of array, into the second half
		perm.copyWithin(0x100, 0x0, 0x100);
	}
}
