			nameLen = p.read(8)
			var attractedBy = ""
			for (let i = 0; i < nameLen; i++) attractedBy += String.fromCharCode(p.read(8))
			if(entType === "Creeper"){
				var explodeAmount = p.read(7)
				var timerStart = now - p.read(32)
			}
