				this.powerChangeUpdate(x+1,y,z, x,y,z, false,dimension)
				this.powerChangeUpdate(x-1,y,z, x,y,z, false,dimension)
				this.powerChangeUpdate(x,y,z+1, x,y,z, false,dimension)
				this.powerChangeUpdate(x,y,z-1, x,y,z, false,dimension)
				this.powerChangeUpdate(x,y+1,z, x,y,z, false,dimension)
